import Header from '../Header.js'
import {useStore} from '../store.js';
import Scene from '../Scene.js';

function Partselecter() {
    const changePink = useStore(state => state.changePink)
    const changeBlue= useStore(state => state.changeBlue)
    return(
    <div className='shellColor'>
        <div className='partselecter'>
         <h1>Welcome to the build a box workshop</h1>
            <h2>Step 1: Choose Your Quadbox shell color</h2>
            <button onClick={changePink} className='pinkbutton'>           </button> 
            <button onClick={changeBlue} className='bluebutton'>           </button>
        </div>
        <div className='buttonColor'>
            <h2>Step 2: Choose Your Button Cap Color</h2>
        </div>
            <div className='canvas'>
            <Scene/>       
        </div>
    </div>
    )
}


export default function Customizer() {

    return (
      <>
      <Header/>
      <Partselecter/>
      </>
  );
}
